import React from 'react'
import { useLayoutEffect } from 'react';
const Home = ({setShowNavbar}) => {


  useLayoutEffect(() => {
    setShowNavbar(false);
}, [])
  return (
    <div>
        <h1> Home page </h1>
    </div>
  )
}

export default Home
